import React from 'react';
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { deleteReparti } from '../../actions/RepartiActions';

function Reparti({ reparti,qytetIdspitaliId }) {
    const dispatch = useDispatch();

    const onDeleteRepartClick = (qytetId, spitaliId, repartiId) => {
        dispatch(deleteReparti(qytetId, spitaliId, repartiId));
        // If you want to navigate to another route after deletion
        // history.push('/some-other-route');
    };
    return (
        <div className='container d-flex flex-row'>
            <div className='card card-body'>
                <div className='row'>
                    <div className='col-md-9'>
                        <div className='container'>
                            <h2>{reparti.name}</h2>
                        </div>
                    </div>
                    <div className='col-md-3'>
                        <ul className='list-group d-flex flex-column'>
                            <Link to={`/employeeList/${reparti.id}`} className='list-group-item'>Qyteti board</Link>
                            <Link to={`/updateQytetiform/${reparti.id}`} className='list-group-item'>Update board</Link>
                            <button 
                                onClick={() => onDeleteRepartClick(qytetId, spitaliId, reparti.id)} 
                                className='list-group-item list-group-item-action'
                            >
                                Delete board
                            </button>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Reparti;
